import React from "react";
import Head from "next/head";
import styles from "../styles/Home.module.css";
import NavigationBar from "../Components/NavigationBar";

//Adding these needed imports
import Timeline from "react-calendar-timeline";
import "react-calendar-timeline/lib/Timeline.css";
import moment from "moment";

// STEP 1: in the terminal inside VS code write: npm install --save react-calendar-timeline moment

// This is needed to group events into different colors to be differentiated

//DOCUMENTATION: https://developer.aliyun.com/mirror/npm/package/react-calendar-timeline
const groups = [
  { id: 1, title: "group 1" },
  { id: 2, title: "group 2" },
];

// STEP 2: search how to deal with dates using MomentJS. then create events in this format below
const events = [
  {
    id: 1,
    group: 1,
    title: "item 1",
    start_time: moment(),
    end_time: moment().add(1, "hour"),
  },
  {
    id: 2,
    group: 2,
    title: "item 2",
    start_time: moment().add(-0.5, "hour"),
    end_time: moment().add(0.5, "hour"),
  },
  {
    id: 3,
    group: 1,
    title: "item 3",
    start_time: moment().add(2, "hour"),
    end_time: moment().add(3, "hour"),
  },
];

export default function about() {
  return (
    <div className={styles.container}>
      <Head>
        <title>PsyDiary</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <NavigationBar />
      <main className={styles.main}>
        <h1 className={styles.title}>Calendar</h1>
        <p className={styles.p}> Find all your past and upcoming sessions.</p>
        <Timeline
          groups={groups}
          items={events}
          defaultTimeStart={moment().add(-12, "hour")}
          defaultTimeEnd={moment().add(12, "hour")}
        />
      </main>
    </div>
  );
}
